import "./App.css";
import theme from "./theme";
import { ThemeProvider } from "@material-ui/core/styles";
import { Typography } from "@material-ui/core";
import CoreSearchBar from './core/components/core-search-bar';

function App() {
  const searchData = ['Salem Community Fridge', 'Salisbury Fridge', 'Sheffield Fridge', 'Springfield Community Fridge', 'Somerville Community Fridge', 'Somerset Community Fridge', 'Southampton Fridge', 'Southwick Fridge', 'South End Fridge', 'South Hadley Community Fridge']
  return (
    <ThemeProvider theme={theme}>
      <Typography variant="h1">Hello World</Typography>
      <CoreSearchBar searchData={searchData} />
    </ThemeProvider>
  );
}

export default App;
